commits.content:
@import url('https://fonts.googleapis.com/css2?family=Great+Vibes&display=swap');
@import url('https://fonts.googleapis.com/css2?family=Inter:wght@400;500;600;700&display=swap');
@import '@/app/globals.css';

@tailwind base;
@tailwind components;
@tailwind utilities;

.luxury-title {
  font-family: 'Great Vibes';
  @apply leading-none;
  @apply text-9xl sm:text-12xl lg:text-15xl;
}

.luxury-title-cap-adjusted {
  @apply luxury-title;
  @apply text-stroke-white text-stroke-3 sm:text-stroke-5;
  @apply text-7xl sm:text-9xl lg:text-10xl;
}

.luxury-subtitle {
  @apply text-3xl sm:text-6xl lg:text-7xl;
}

.button {
  @apply component;
}

h3 {
  @apply text-2xl sm:text-3xl lg:text-4xl;
}

h4 {
  @apply text-xl sm:text-2xl lg:text-3xl;
}

.text {
  font-size: 17px;
  font-family: 'Inter', 'Helvetica Neue', Helvetica, Arial, sans-serif;
  @apply transition-all-1;
}

.component {
  @apply transition-all-1;
  @apply scale-75 sm:scale-100;
}

@layer base {
  body {
    color: rgb(var(--foreground-rgb));
  }

  .title,
  h1,
  h2,
  h3,
  h4,
  h5,
  h6 {
    @apply text;
    @apply font-bold;
  }

  body,
  p,
  span,
  a,
  li,
  blockquote,
  pre,
  code {
    @apply text;
  }
}

.transition-all-1 {
  transition: all 1.0s ease;
}

.glass {
  background: rgba(255, 255, 255, 0.05);
  backdrop-filter: blur(2px);
}
